meta.script:
$(document).ready(function() {
	if (ClipboardJS.isSupported()) {
		var clipboard = new ClipboardJS('.copy2cb');
		clipboard.on('success', function (e) {
			console.info('Trigger:', e.trigger);
			var tip = $(e.trigger).next().children().first();
			tip.show();
			window.setTimeout(function() { tip.hide(); }, 1000);
			e.clearSelection();
		});
	} else {
		$(".copy2cb").hide();
	}
});

div.script:
    $(document).ready(function () {
        if (navigator && navigator.userAgent && navigator.userAgent.toUpperCase().indexOf('GOOGLEBOT') >= 0) {
            $("#uploadheader").remove();
            $("#uploadresults").remove();
            $("#uploadbutton").remove();
            return;
        } else {
            console.log(navigator.userAgent);
        }
        $.ajax({
            dataType: "jsonp",
            error: function (xhr, status, err) {
                var content = $("#uploadresults").empty();
                content.append($("
").addClass("alert").addClass("alert-danger").text(err));
                console.error("ERROR: " + status, err);
            },
            method: "GET",
            success: function (data, status, xhr) {
                console.log("data=" + JSON.stringify(data));
                var content = $("#uploadresults").empty();
                if (!data.success) {
                    content.append($("
").addClass("alert").addClass("alert-warning").text(data.message));
                }
                else {
                    for (var image of data.images) {
                        console.log(image);
                        content.append($("").attr("href", image.url).append($("").attr("src", image.src || image.image).css("max-width", "270px").css("height", "90px")));
                    }
                }
            },
            timeout: 15000,
            url: "https://upload.vectorlogo.zone/logos/nodejs/pending.json"
        });
    });

